import { Link } from 'react-router-dom';
import React from 'react';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Input from '@material-ui/core/Input';
import Paper from '@material-ui/core/Paper';
import withStyles from '@material-ui/core/styles/withStyles';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import styles from './Style';
const firebase = require("firebase");

class Login extends React.Component {
render(){
    const { classes } = this.props;
return(
    <main className={classes.main}>
    <CssBaseline></CssBaseline>
    <Paper className={classes.paper}>
        <Typography component='h1' variant='h5'>
            Увійти
        </Typography>
        <form onSubmit={(e) => this.submitLogin(e)} className={classes.form}>
        <FormControl require fullWidth margin='normal' >
                    <InputLabel htmlFor='login-email-input'>
                        Введіть свій email
                    </InputLabel>
                    <Input onChange={(e) => this.userTyping('email', e)} autoComplete='email'autoFocus id='login-email-input' ></Input>
                </FormControl>
        </form>
    </Paper>    
    </main>
)
}
